const regex = /([\S\s]){1,80}\b/g;

function StringDisplay(props) {
  const newString = props.string.match(regex);
  console.log(props.string);
  console.log(newString);

  return (
    <div>
      {newString.map((line) => (
        <div>
          {line} {line.length}
        </div>
      ))}
    </div>
  );
}

export default StringDisplay;
